import React from 'react';


const Person=(props)=>{
    return(
        <div className='bg-light-red ba contain w-200' >
            <img src= 'http://lorempixel.com/200/200/people' alt='every-day people' />
            <h1>{props.name}</h1>
            <p>{props.email}</p>
            <span>
                <p>{props.street1}<br/>{props.street2}<br/>{props.street3}</p>
            </span>
        </div>
    )
}

export default Person
